  \"2016-07-27T22:54:25.094064\",\n\t\"name\": \"union-slough-national-wildlife-refuge-narrative-report-september-october-november-and-dece-91d13\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Union Slough
  NWR outlines Refuge accomplishments from September through December of 1951. The
  report begins by summarizing the weather conditions and water conditions during
  this period. Wildlife- including migratory birds, upland game birds, furbearers,
  raptors, and fish- is also covered. The Refuge development and maintenance section
  discusses physical developments and plantings. Resource management is outlined;
  topics include grazing and fur harvesting. The public relations section of the report
  describes recreational uses, Refuge visitors, Refuge participation, hunting, fishing,
  and violations. Items of interest and N-R forms are attached.\",\n\t\"license_title\":
